import React from 'react'
import styled from 'styled-components'

import MenuNavbar from './MenuNavbar.js'
import MenuItem from './MenuItem.js'
import { menuData } from './menuData.js'
import Header from '../../../images/Dominos_Pizza2.jpg'
import Heading from '../../../style/FormUI/Heading'

const Wrapper = styled.div`
    width: 100%;
    display: flex;
    flex-direction: column
    align-items: center;
`
const HeaderImg = styled.img`
    position: relative;
    width: 100%;
    height: 30rem;
    overflow: hidden;
`
const Content = styled.div`
position: relative;

    width: 60%;
`
const DescriptionWrapper = styled.div`
`

const MenuItems = () => {
    const menu = menuData.map(item => <MenuItem key = {item.id} name = {item.name} picture = {item.src} description = {item.description}/>)

    return (
        <Wrapper>
            <HeaderImg src = {Header} alt = "Dominos"/>
            <MenuNavbar />
            <Content>
                <DescriptionWrapper>
                    <Heading noMargin bold size = "h2"> Reset Your Password </Heading>
                    <Heading size = "h4"> Type in your email to receive a new password. You can change it later in your profile. </Heading>
                </DescriptionWrapper>
                {menu}
            </Content>
        </Wrapper>

    )
}

export default MenuItems
